    {
      id: 3,
      name: "AnnaPannaKiralylany",
      email: "annasomoss@gmail.com"
    }
  ]);

  return (
    <div className="App">
        <Routes>
          <Route index element={<Home/>}/>
          <Route path='/friends' element={<UsersList users={users}/>}/>
          {/*<Route path='/friends' element={<Users/>}/>
